  constructor(props) {
    super(props);
    this.state = {
    }
  }

  render() {
      return(
        <div>
          <Container>
            <h3>Login</h3>
            <Col md={5}>
              <Form>
                <Form.Group className="mb-3" controlId="nama">
                  <Form.Label></Form.Label>
                  <Form.Control
                    type="text"
                    name="nama"
                  />
                </Form.Group>
              </Form>
            </Col>
          </Container>
        </div>
      )
    }
  }
export default App_Login;
